Sometimes, the creator of a partial may want it to be explicitly implemented via the impl keyword. Place a ! after the partial type in order to make sure that the provided struct fits the partial: type Add<Other, Output> = { add: (other: Other) -> Output
} static add = fn<Other, Output>(a: Add<Other, Output>!, b: Other) -> Output { a.add(b);
} struct Token { value: char, static create: fn(value: char) -> Token { new Token { value }; } add: fn(other: Token) -> Token { new Token { value: self.value + other.value }; }
} main { let tok1 = Token::create('a'); let tok2 = Token::create('b'); add<Token, Token>(tok1, tok2); // Invalid, because "Token" doesn't explicitly fit `Add`!
} Correct implementation: struct Token { value: char
} impl Add<Token, Token> for Token { add: fn(other: Token) -> Token { new Token { value: self.value + other.value }; }
} main { add<Token, Token>(Token::create('a'), Token::create('b')); // "ab"
}

